subSubSection.paragraph:
Description
. Shell globular, medium size to large (
3.6 mm
). Protoconch 3/4 whorls, with flocculant sculpture, varix present, varix not connected to embryonic cap. Teleoconch I with spiral cord in area of selenizone, often with additional spiral cords, but no centrifugal cords, more than 0.5 whorls. Teleoconch II with up to 2.5 whorls. Sculpture on shoulder consisting of 1–4 spirals at the start of teleoconch II, approximately 12 spirals at aperture of fully grown specimens (
2.5 mm
), spirals on early part of teleoconch II much weaker than axials, at aperture at most as strong as axials; approximately 70–75 axials on shoulder and base of body whorl in fully grown shell. Base with approximately a dozen spiral cords. Spirals on base as strong as axials; spirals running over axials forming weak nodule. Umbilicus sloping continuously from base, narrow, deep. Selenizone at periphery, keels distinct, growth lines in selenizone not coordinated with axials; margins of slit converging towards apertural margin of shell. Aperture rounded, somewhat flared. Operculum multispiral, nucleus central, corneus, thin. Animal unknown.
